import React from 'react'

function Detail() {
    return (

        <div className= "map-container"> 
        {this.state.users.map((item)=>(
           <h2 key={item.id}> name: {item.name} email: {item.email} </h2>
        ))}
        </div>

    )
    }
export default Detail;
